import React from 'react';
import { Box, Button, Typography, Grid, Card } from '@mui/material';
import { Link, useNavigate } from 'react-router-dom';

const Header = ({ setIsLoggedIn }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Clear login state
    setIsLoggedIn(false);
    // Redirect to login page
    navigate("/login");
  };

  // Define pattern and distance for positioning the cards with tighter spacing
  const cardPositionsTop = [
    { top: '10vh', left: '10vw' },  // Deposit Money
    { top: '10vh', left: '35vw' },  // Withdraw
    { top: '10vh', left: '60vw' },  // Transfer Money
  ];

  const cardPositionsBottom = [
    { top: '60vh', left: '20vw' },  // Check Balance
    { top: '60vh', left: '55vw' },  // Extra Demo Box
  ];

  return (
    <Box sx={{ padding: 4, display: 'flex', flexDirection: 'column', height: '100vh', position: 'relative' }}>
      {/* Header Section with Logout Button */}
      <Grid container spacing={4} justifyContent="center" sx={{ flex: 1, position: 'relative' }}>

        {/* Top 3 Floating Cards */}
        {cardPositionsTop.map((position, index) => {
          return (
            <Grid item key={index} style={{ position: 'absolute', top: position.top, left: position.left }}>
              <Card
                sx={{
                  width: 180,
                  height: 180,
                  display: 'flex',
                  flexDirection: 'column',
                  justifyContent: 'center',
                  alignItems: 'center',
                  backgroundColor: '#f5f5f5',
                  boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
                  borderRadius: '10px',
                  transition: 'all 0.3s ease',
                  '&:hover': {
                    boxShadow: '0 12px 20px rgba(0, 0, 0, 0.2)',
                    transform: 'scale(1.05)',
                  }
                }}
              >
                {/* Links and Texts */}
                {index === 0 && (
                  <Link to="/deposit" style={{ textDecoration: 'none', width: '100%' }}>
                    <Typography
                      variant="h6"
                      sx={{
                        color: '#333',
                        fontWeight: 'bold',
                        textAlign: 'center',
                        padding: '0 0 10px 0',
                        fontSize: '18px',
                      }}
                    >
                      Deposit Money
                    </Typography>
                  </Link>
                )}
                {index === 1 && (
                  <Link to="/withdraw" style={{ textDecoration: 'none' }}>
                    <Typography variant="h6" sx={{ color: '#333', fontWeight: 'bold' }}>
                      Withdraw
                    </Typography>
                  </Link>
                )}
                {index === 2 && (
                  <Link to="/transfer" style={{ textDecoration: 'none' }}>
                    <Typography variant="h6" sx={{ color: '#333', fontWeight: 'bold' }}>
                      Transfer Money
                    </Typography>
                  </Link>
                )}

                {/* Mewo Bank Label */}
                <Typography
                  variant="body2"
                  sx={{
                    color: '#333',
                    fontStyle: 'italic',
                    textAlign: 'center',
                    fontSize: '14px',
                    marginBottom: '5px',
                  }}
                >
                  Mewo Bank
                </Typography>
              </Card>
            </Grid>
          );
        })}

        {/* Bottom 2 Floating Cards */}
        {cardPositionsBottom.map((position, index) => {
          return (
            <Grid item key={index} style={{ position: 'absolute', top: position.top, left: position.left }}>
              <Card
                sx={{
                  width: 180,
                  height: 180,
                  display: 'flex',
                  flexDirection: 'column',
                  justifyContent: 'center',
                  alignItems: 'center',
                  backgroundColor: '#f5f5f5',
                  boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
                  borderRadius: '10px',
                  transition: 'all 0.3s ease',
                  '&:hover': {
                    boxShadow: '0 12px 20px rgba(0, 0, 0, 0.2)',
                    transform: 'scale(1.05)',
                  }
                }}
              >
                {/* Links and Texts */}
                {index === 0 && (
                  <Link to="/check-balance" style={{ textDecoration: 'none' }}>
                    <Typography variant="h6" sx={{ color: '#333', fontWeight: 'bold' }}>
                      Check Balance
                    </Typography>
                  </Link>
                )}
                {index === 1 && (
                  <Typography
                    variant="h6"
                    sx={{
                      color: '#333',
                      fontWeight: 'bold',
                      textAlign: 'center',
                      padding: '10px 0',
                      fontSize: '18px',
                    }}
                  >
                    Demo Box
                  </Typography>
                )}

                {/* Mewo Bank Label */}
                <Typography
                  variant="body2"
                  sx={{
                    color: '#333',
                    fontStyle: 'italic',
                    textAlign: 'center',
                    fontSize: '14px',
                    marginBottom: '5px',
                  }}
                >
                  Mewo Bank
                </Typography>
              </Card>
            </Grid>
          );
        })}
      </Grid>

      {/* Logout Button at the Bottom */}
      <Button
        variant="contained"
        color="secondary"
        onClick={handleLogout}
        sx={{ marginTop: 'auto' }}
      >
        Logout
      </Button>
    </Box>
  );
};

export default Header;
